const totals={'First Year':{'1st Semester':{'lecture':418,'lab':66,'credit_units':484},'2nd Semester':{'lecture':484,'lab':44,'credit_units':528}},'Second Year':{'1st Semester':{'lecture':374,'lab':66,'credit_units':440},'2nd Semester':{'lecture':374,'lab':66,'credit_units':440}},'Third Year':{'1st Semester':{'lecture':330,'lab':66,'credit_units':396},'2nd Semester':{'lecture':308,'lab':88,'credit_units':396}},'Fourth Year':{'1st Semester':{'lecture':308,'lab':88,'credit_units':396},'2nd Semester':{'lecture':176,'lab':22,'credit_units':198}}};document.addEventListener("DOMContentLoaded",function(){for(const[year,semesters]of Object.entries(totals)){for(const[semester,details]of Object.entries(semesters)){document.getElementById(`lecture-${year}-${semester}`).innerText=details.lecture;document.getElementById(`lab-${year}-${semester}`).innerText=details.lab;document.getElementById(`credit_units-${year}-${semester}`).innerText=details.credit_units;}}});;